import React from 'react';
import classNames from 'classnames';

export default function LaunchItem(props) {
    console.log(props.launch)

    //For step-by-step live changes view, add code while watching on the browser
    return (
        <div className="card card-body mb-3">
            <div className="row">
                <div className="col-md-9">
                    <h4>Mission: 
                        <span className={classNames({
                            'text-success': launch_success, //text-success and text-danger are bootstrap specific classes
                            'text-danger': !launch_success 
                            })}>
                            {props.launch.mission_name}
                        </span> 
                    </h4>
                    <p>Date: {props.launch.launch_date_local}</p>
                </div>
                <div className="col-md-3">
                    <button className="btn btn-secondary">Launch Details</button>
                </div>
            </div>
        </div>
    );
}
